import React from 'react';
import AddIcon from '@mui/icons-material/Add'; 
import CardMembershipIcon from '@mui/icons-material/CardMembership'; 
import KeyboardReturnIcon from '@mui/icons-material/KeyboardReturn';
import SearchIcon from '@mui/icons-material/Search';
import { Link } from 'react-router-dom';

const Member = () => {  
    return (  
        <div className="ml-[25%] p-5 w-full"> 
            {/* block for banner */}  
            <div className='border-2 bg-slate-900 flex justify-between w-full text-white rounded-lg p-3'>
                <button className="bg-slate-900 border border-white text-white px-5 py-1.5 rounded-full hover:bg-green-600 flex items-center transition-colors">
                    Add Member
                    <AddIcon className="ml-1" fontSize="small" />
                </button>  
                <button className="bg-slate-900 border border-white text-white px-5 py-1.5 rounded-full hover:bg-green-600 flex items-center transition-colors">
                    Membership
                    <CardMembershipIcon className="ml-1" fontSize="small" />
                </button>
            </div>  

            {/* block for back to dashboard */}
            <Link to="/dashboard" className="flex items-center mt-4 text-blue-600 hover:text-blue-800 transition-colors">
                <KeyboardReturnIcon className="mr-1" /> 
                Back to Dashboard
            </Link>

            <div className="mt-4 flex gap-2 w-1/2">
                <input type = "text" className='border-2 w-full p-2 rounded-lg' placeholder='Search by Name or Phone Number'></input>
                <div className='bg-white p-3 border-2 text-black     rounded-lg cursor-pointer hover:bg-gradient-to-r from-indigo-500 via-purple-500 to-pink-500 hover:text-black'><SearchIcon/></div>
            </div>
        </div>  
    );  
}  

export default Member;
